    "name": "Total Fertility Rate and Reproduction Rate",
    "status": "active",
    "description": "Total Fertility Rate refers to the average number of live-births each female would have during her reproductive years if she were to experience the age-specific fertility rates prevailing during the period. It is derived by aggregating the age-specific fertility rates of females in each of the reproductive ages for a specific year. \r\n\r\nGross Reproduction Rate refers to the average number of daughters each female would have during her reproductive years if she were to experience the age-specific fertility rates prevailing during the period. \r\n\r\nNet Reproduction Rate refers to the average number of daughters each female would have during her reproductive years if she were to experience the age-specific fertility and mortality rates prevailing during the period. It is a refinement of the gross reproduction rate, and is also the measure of replacement of population. \r\n\r\nData prior to 1980 pertain to total population. \r\nData from 1980 onwards pertain to resident population (i.e. Singapore citizens and permanent residents).\r\n",
    "format": "CSV",
