    "status": "active",
    "description": "\"(1) The channelling of Primary 3 students into Primary 4 Normal, Extended and Monolingual streams was replaced in 1992 by channelling at Primary 4 into Primary 5 EM1, EM2 and EM3 streams.\t\t\t\t\t\t\t\t\t\t\t\t\t\n(2) Total primary enrolment includes Primary 7 and Primary 8 students from the Extended and Monolingual streams.\t\t\t\t\t\t\n(3) Since 2004, the distinction between the EM1 and EM2 streams have been removed and schools were given the autonomy to decide on how best to band their students by ability, in ways that added the most educational value. Since 2008, Subject-based Banding was introduced for the Primary 5 cohort and streaming was removed. With Subject-based Banding, students are able to offer a mix of Standard or Foundation level subjects depending on their aptitude in each subject.\t\t\t\t\t\t\t\"",
