    "datasetId": "d_aa75b9227b47cbc12ffe0e3be4979546",
    "createdAt": "2016-04-15T01:46:00+08:00",
    "name": "Median Gross Monthly Income From Work of Full-Time Employed Residents by Sex",
    "status": "active",
    "description": "* Data are for mid-year. \r\n* Residents refer to Singapore Citizens and Permanent Residents.\r\n* Data for 2005 are not available as the Comprehensive Labour Force Survey was not conducted in these years due to the conduct of the General Household Survey 2005 by the Singapore Department of Statistics.\r\n* 2007 data have been adjusted based on latest revised population estimates from the Singapore Department of Statistics to facilitate comparisons with 2008 onwards.\r\n* Data pertain to full-time employed residents excluding full-time National Servicemen. \r\n* Before 2009, full-time employment refers to employment where the normal hours of work is at least 30 hours per week. From 2009 onwards, it refers to employment where the normal hours of work is at least 35 hours per week.\r\n* Gross monthly income from work refers to income earned from employment. For employees, it refers to the gross monthly wages or salaries before deduction of employee CPF contributions and personal income tax. It comprises basic wages, overtime pay, commissions, tips, other allowances and one-twelfth of annual bonuses. For self-employed persons, gross monthly income refers to the average monthly profits from their business, trade or profession (i.e. total receipts less business expenses incurred) before deduction of income tax. \r\n\r\nSource: Comprehensive Labour Force Survey, Manpower Research & Statistics Department, MOM",
