    "status": "active",
    "description": "( Figures as at End-Year )\r\n\r\nExplanatory Notes:\r\n\r\nA person may hold more than one class of qualified driving license.\r\n\r\nTypes of class of qualified driving licence and the types of vehicles the qualified licence holders is allowed to operate:\r\n\r\n* __Class 2B__: Motorcycle not exceeding 200cc\r\n\r\n* __Class 2A__: Motorcycle between 201cc and 400cc\r\n* __Class 2__: Motorcycle exceeding 400cc \r\n* __Class 3__: \r\n\r\n    1. Motor car and motor tractor, the weight of which unladen does not exceed 2500 kilograms; and \r\n    2. Motor cars constructed solely and adapted to carry not more than 7 passengers (exclusive of the driver) and the weight of which unladen does not exceed 3000 kilograms\r\n\r\n* __Class 3A__: Motor vehicles which consist of any Class 3 vehicle which can be driven without the use of a clutch pedal\r\n* __Class 3C__: Motor cars constructed solely and adapted to carry not more than 7 passengers (exclusive of the driver) and the weight of which unladen does not exceed 3000 kilograms. Issued only to work permit and S-Pass holders\r\n* __Class 3CA__: Motor vehicles which consist of any Class 3C vehicle which can be driven without the use of a clutch pedal. Issued only to work permit and S-Pass holders\r\n* __Class 4A__: Omnibus\r\n* __Class 4__: Heavy motor car and motor tractor the weight of which unladen exceeds 2500 kilograms\r\n* __Class 5__: Motor vehicle which is not constructed to carry any load and the weight of which unladen exceeds 7250 kilograms (includes light and heavy locomotives)",
