    "description": "* For FY2009-FY2015, the industries are classified according to Singapore Standard Industrial Classification (SSIC) 2010.   \r\n   (a) Utilities includes Electricity, Gas & Air-Conditioning Supply, Water Supply, Sewerage, Waste Management & Remediation Activities.    \r\n   (b) Other Goods Industries includes Agriculture & Fishing and Mining & Quarrying.    \r\n   (c) Real Estate & Business Activities includes Real Estate Activities, Professional, Scientific & Technical Activities, Administrative & Support Service Activities.    \r\n   (d) Others includes all other industries such as Education, Health & Social Services, Arts, Entertainment & Recreation, Other Service Activities.    \r\n\r\n* The industries are classified according to Singapore Standard Industrial Classification (SSIC) 2015 for FY2016-FY2017; SSIC 2015 (Version 2018) for FY2018-FY2019.    \r\n   (a) Utilities includes Electricity, Gas, Steam & Air-Conditioning Supply, Water Supply, Sewerage, Waste Management & Remediation Activities.    \r\n   (b) Other Goods Industries includes Agriculture & Fishing and Mining & Quarrying.    \r\n   (c) Real Estate & Business Activities includes Real Estate Activities, Professional, Scientific & Technical Activities, Administrative & Support Service Activities.    \r\n   (d) Others includes all other industries such as Education, Health & Social Services, Arts, Entertainment & Recreation, Other Service Activities.\r\n\r\n* The industries are classified according to Singapore Standard Industrial Classification (SSIC) 2020 from FY2020.    \r\n   (a) Utilities includes Electricity, Gas, Steam & Air-Conditioning Supply, Water Supply, Sewerage, Waste Management & Remediation Activities.    \r\n   (b) Other Goods Industries includes Agriculture & Fishing and Mining & Quarrying.    \r\n   (c) Real Estate & Business Activities includes Real Estate Activities, Professional, Scientific & Technical Activities, Administrative & Support Service Activities.    \r\n   (d) Others includes all other industries such as Education, Health & Social Services, Arts, Entertainment & Recreation, Other Service Activities.\r\n\r\n* There will be differences between GST Contribution and Tax Collection for GST published on data.gov.sg. GST Contribution is the net amount that is payable or refundable by a taxpayer after accounting for input and output tax etc. This might be different from the Tax Collection for GST as the taxes can be collected or refunded across different Financial Years (FY) due to taxpayers paying their taxes via GIRO instalments or having their past years’ assessments reviewed.",
