    "description": "1. Reference month of June\n2. Residents refer to Singapore Citizens and Permanent Residents.\n3. Resident labour force refers to persons aged 15 & over who were either employed or unemployed during the reference period.\n4. Unemployed residents refers to persons aged 15 years and over who are not working but are actively looking for a job and available for work during the reference period. They include persons who are not working but are taking steps to start their own business or taking up a new job after the reference period.\n5. Residents outside the labour force refer to persons aged 15 & over who were not working, did not have a job to return to and were not actively looking for a job during the reference period.\n6. Data for 1995, 2000 and 2005 are not available as the Comprehensive Labour Force Survey was not conducted in these years due to the conduct of the Population Census 2000, General Household Surveys 1995 and 2005 by the Singapore Department of Statistics.\n7. 2007 data have been adjusted based on latest revised population estimates from the Singapore Department of Statistics to facilitate comparisons with 2008 onwards.\n\nSource: Comprehensive Labour Force Survey, Manpower Research & Statistics Department, MOM",
