    "description": "The residential rental index covers only private residential properties.  It does not cover HDB flats. \r\n\r\nThe rental index is computed from information obtained in returns filed with the Inland Revenue Authority of Singapore (IRAS).  When a property is let out, the property owner has to inform IRAS the details of the tenancy agreement. Besides an overall rental index for private residential properties, sub-indices for landed and non-landed properties are also compiled. From the 2015-Q1, a “stratified hedonic regression methodology” is used to compute the rental indices. Under this method, variations in the attributes of rental private properties transacted such as age and unit size are controlled for by using hedonic regression and rental movements are aggregated using 5-quarter fixed weights to derive the aggregate rental change.",
