    "status": "active",
    "description": "Source: ACCOUNTING AND CORPORATE  REGULATORY AUTHORITY\r\n\r\nData Last Updated: 15/01/2024\r\n\r\nFootnotes: Due to a system issue in May 2023, there was a delay in the striking off process of companies and Limited Liability Partnerships.  The issue was rectified in Jun 2023 and ACRA has since resumed the standard processing time for striking off applications.  This has consequential effect on the published cessation statistics from Jul to Nov 2023.  Due to Covid-19 pandemic and the implementation of Circuit Breaker in Singapore from 7 Apr to 1 Jun 2020, ACRA had extended the time for relevant parties to respond to notices for the striking off applications by companies and limited liability partnerships.  This has a consequential effect on the published cessation statistics for Aug to Oct 2020.  ACRA has since resumed the standard processing time for striking off applications.  The statistics on business entities cessation till 2017 have been adjusted to provide a more accurate reflection of the underlying cessation trends.  In 2016 and 2017, ACRA conducted periodic reviews and removed from its public register, sole proprietorships and partnerships that failed to renew their registrations, and companies that were dormant.  These periodic removal of business entities took place at ad hoc intervals and impacted published statistics on business entities cessation.  The number of business entities cessation have therefore been adjusted to reflect the removal of such business entities at the date when they would have normally been removed.  Going forward, such review and removal exercises will be conducted on a regular basis to provide a more accurate reflection of cessation trends.",
