    "status": "active",
    "description": "Source: SINGAPORE DEPARTMENT OF STATISTICS\r\n\r\nData Last Updated: 29/12/2023\r\n\r\nFootnotes: With the implementation of the recommendations of the 6th Edition of the Balance of Payments and International Investment Manual (BPM6), Singapore's gross external debt is now reported on a BPM6 format.  The accompanying revision in the treatment of Asian Currency Units (ACUs) as resident units (which previously were treated as non?resident units) means that the coverage of Singapore's external assets and liabilities has been expanded to include those of the ACUs, resulting in increases in both Singapore's external assets and liabilities.  While the expansion of coverage has resulted in higher gross external debt (or liabilities), it has resulted also in higher external assets.  Singapore remains a net creditor, as the resulting increase in external assets is more than the increase in liabilities.  More information may be found in the Occasional Paper on \"\"Implementation of IMF Balance of Payments and International Investment Position Manual, Sixth Edition in Singapore's Balance of Payments\"\".",
